export default class Home extends React.Component {
    constructor(props) {
        super(props)
        fetch("http://localhost:8000/api/home").then(async response=>{
            const res = await response.json();
            
            this.state = res;
        });
    }
    componentDidMount(){
        
        console.log(this.state);
    }
   
    componentDidUpdate(){
        console.log("updated");
    }
    render(){
        return(
            <div></div>
        )
    }
}
